Ext.define('Rai.view.frmServiziViewController5', {
    extend: 'Ext.app.ViewController',
    alias: 'controller.frmprofilimanager',

    id: 'frmUtentiManager',

    onFrmUtentiManagerAfterRender: function(component, eOpts) {

        var storeUser = Ext.StoreManager.lookup('storeUtenti');

        storeUser.filter({
            property: "divisione",
            value: USER.divisione ,
            operator: "streq"
        });

        storeUser.filter({
            property: "superiore",
            value: "%"+USER.userName+"%",
            operator: "like"
        });

    }

});
